import React from 'react'
import Task from '../Components/Task'

function TasksContainer(props) {

    function renderTask() {
        let tasks = props.tasks
        return tasks.filter(el => < Task task={el}/>)
    }

    return(
        <div class="tasks">
            <h4>Tasks</h4>
            {renderTask()}
            {/* < Task /> */}
        </div>
    )
}

export default TasksContainer
